import Card from "../UI/Card";
import CartItem from "./CartItem";

const Cart = (props) => {
  const cartItems = [
    { id: "c1", name: "Sushi", price: "22.99", amount: "1" },
    { id: "c2", name: "Schnitzel", price: "16.5", amount: "4" },
  ];
  return (
    <Card>
      <ul>
        {cartItems.map((cartItem) => {
          <CartItem />;
        })}
      </ul>
      <div></div>
      <div></div>
    </Card>
  );
};
export default Cart;
